import Navbar from './components/layout/Navbar';
import React, { Component } from 'react';
import {BrowserRouter, Switch, Route} from 'react-router-dom';
import Dashboard from './components/layout/Dashboard'
import ResponderAuditoria from './components/auditorias/ResponderAuditoria'
import SignIn from './components/auth/SignIn'
import SignUp from './components/auth/SignUp'
import CrearAuditoria from './components/auditorias/CrearAuditoria'

class App extends Component {
  render() {
    return (
      <BrowserRouter>
        <div className="App">
          <Navbar />
          <Switch>
            <Route exact path="/" component={Dashboard}/>
            <Route path="/auditoria/:id" component={ResponderAuditoria} />
            <Route path="/signin" component={SignIn} />
            <Route path="/signup" component={SignUp} />
            <Route path="/crear-auditoria" component={CrearAuditoria} />
          </Switch>
        </div>
      </BrowserRouter>
    );
  }
}

export default App;
